--  DDL for Trigger DEVICE_ATTENDANCE_TRIGGER
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "DEVICE_ATTENDANCE_TRIGGER" 
   AFTER INSERT
   ON HRIS_ATTENDANCE
   FOR EACH ROW
DECLARE
   temp_in_time   TIMESTAMP (6) := NULL;
BEGIN
    BEGIN 
           SELECT IN_TIME
             INTO temp_in_time
             FROM HRIS_ATTENDANCE_DETAIL
            WHERE ATTENDANCE_DT = TO_DATE (:new.ATTENDANCE_DT, 'DD-MON-YY')
                  AND EMPLOYEE_ID = :new.EMPLOYEE_ID;
       EXCEPTION
        WHEN NO_DATA_FOUND THEN
            DBMS_OUTPUT.PUT_LINE ('Attendance Job for '||:new.ATTENDANCE_DT||' not excecuted');
         END;

   IF (temp_in_time IS NULL)
   THEN
      UPDATE HRIS_ATTENDANCE_DETAIL
         SET IN_TIME =
                TO_DATE (
                   TO_CHAR (:new.ATTENDANCE_TIME, 'DD-MON-YY HH:MI AM'),
                   'DD-MON-YY HH:MI AM')
       WHERE ATTENDANCE_DT = TO_DATE (:new.ATTENDANCE_DT, 'DD-MON-YY')
             AND EMPLOYEE_ID = :new.EMPLOYEE_ID;
   ELSE
      UPDATE HRIS_ATTENDANCE_DETAIL
         SET OUT_TIME =
                TO_DATE (
                   TO_CHAR (:new.ATTENDANCE_TIME, 'DD-MON-YY HH:MI AM'),
                   'DD-MON-YY HH:MI AM')
       WHERE ATTENDANCE_DT = TO_DATE (:new.ATTENDANCE_DT, 'DD-MON-YY')
             AND EMPLOYEE_ID = :new.EMPLOYEE_ID;
   END IF;
END;



/
ALTER TRIGGER "DEVICE_ATTENDANCE_TRIGGER" ENABLE;
