--  DDL for Function AD_DATE
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "AD_DATE" (PassedDate IN VARCHAR2) RETURN DATE IS
  BSMonth VARCHAR2(7);
  ADDate DATE;
  DaysNo NUMBER(2);
  ReturnDate DATE;
BEGIN
  /*
  Checking and validating passed date
  By full length
  By Year
  By Month
  By Days
  By Operator Sign
  */
  IF LENGTH(PassedDate) <> 10 OR
     TO_NUMBER(SUBSTR(PassedDate,1,4)) NOT BETWEEN 2000 AND 2099 OR
     TO_NUMBER(SUBSTR(PassedDate,6,2)) NOT BETWEEN 1 AND 12 OR
     TO_NUMBER(SUBSTR(PassedDate,9,2)) NOT BETWEEN 1 AND 32 OR
     SUBSTR(PassedDate,5,1) <> '-' OR
     SUBSTR(PassedDate,8,1) <> '-' THEN
     RETURN NULL;
  END IF;

  /*
  Fetch the current required record for the date manipulation
  */

  SELECT BS_Month, AD_Date, Days_No INTO BSMonth, ADDate, DaysNo
  FROM Calendar_Setup
  WHERE BS_Month = SUBSTR(PassedDate,1,7);

  /*
  checking and validating days no. with DaysNo as per database
  */

  IF TO_NUMBER(SUBSTR(PassedDate,9,2)) > DaysNo THEN
     RETURN NULL;
  ELSE
  /*
  Success!! Return date by adding no. of days on first ad date for the
  Month
  */
     ReturnDate := ADDate + TO_NUMBER(SUBSTR(PassedDate,9,2)) - 1;
     RETURN ReturnDate;
  END IF;

  /*
  Handling error cases for no data found, too many errors
  and others
  */
  EXCEPTION
    WHEN NO_DATA_FOUND THEN
       RETURN NULL;
    WHEN TOO_MANY_ROWS THEN
       RETURN NULL;
    WHEN OTHERS THEN
       RETURN NULL;
END;
 
 
 

/
--------------------------------------------------------
--  DDL for Function BS_DATE
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "BS_DATE" (PassedDate IN DATE) RETURN VARCHAR2 IS
  BSMonth VARCHAR2(7);
  ADDate DATE;
  DaysNo NUMBER(2);
  Result VARCHAR2(10);
  TotalDays NUMBER;
  BarDays VARCHAR2(2);
BEGIN
  /*
  Fetching record from database
  which is maximum recordset
  but less than passed date
  */

  SELECT BS_Month, AD_Date, Days_No INTO BSMonth, ADDate, DaysNo
  FROM Calendar_Setup
  WHERE AD_Date IN
  (SELECT MAX(AD_Date) FROM Calendar_Setup
  WHERE AD_Date <= PassedDate);

  /*
  Find no. of days count adding 1
  */
  TotalDays := (PassedDate - ADDate) + 1;

  /*
  When database found no records further then, it returns high
  value in total days.So, checking whether total days is exceeded
  by DaysNo or not
  */

  IF TotalDays > DaysNo THEN
     Result :='0000-00-00';
  ELSE
     BarDays := TO_CHAR(TotalDays);

     /*
     Days found in single digit, so concatenate with 0 for thoses days
     */

     IF LENGTH(BarDays) = 1 THEN
        BarDays := '0'||BarDays;
     END IF;

     /*
     Success !! store date format with followings
     */

     Result := BSMonth||'-'||BarDays;
  END IF;

  /*
  Returing result
  */

  RETURN Result;

  /*
  Handling error cases
  */
  EXCEPTION
    WHEN NO_DATA_FOUND THEN
      Result :='0000-00-00';
      RETURN Result;
    WHEN TOO_MANY_ROWS THEN
      Result :='0000-00-00';
      RETURN Result;
END;
 
 
 

